import Switch from "react-switch";

export const columns = [
     {
          name: 'Product',
          selector: row => row.product,
          sortable: true,
     },
     {
          name: 'Brand',
          selector: row => row.brand,
          sortable: true,
     },
     {
          name: 'Supplier',
          selector: row => row.supplier,
          sortable: true,
     },
     {
          name: 'Inventory',
          selector: row => row.inventory,
          sortable: true,
     },
     {
          name: 'Retail Price',
          selector: row => row.retailPrice,
          sortable: true,
     },
     {
          name: 'Channels',
          selector: row => row.channels,
          sortable: true,
     },
     {
          name: 'Created',
          selector: row => row.created,
          sortable: true,
     },
     {
          cell: (row) => <Switch onColor='#3f32f5' />,
          ignoreRowClick: true,
          allowOverflow: true,
          button: true,
     },
];

export const data = [
     {
          product: 'Beetlejuice',
          brand: '1988',
          supplier: 'selet',
          inventory: 'Tim Burton',
          retailPrice: 'Tim Burton',
          channels: 'Tim Burton',
          created: 'Tim Burton',
     },
     {
          product: 'Beetlejuice',
          brand: '2000',
          supplier: 'selet',
          inventory: 'Tim Burton',
          retailPrice: 'Tim Burton',
          channels: 'Tim Burton',
          created: 'tiger',
     }
];
